import React from "react";
import "./App.css";
import Sidebar from "./components/Sidebar";
import Main from "./components/Main";

const App = () => {
  return (
    <div className="App">
      <Sidebar />
      <Main />
    </div>
  );
};
const mapStateToProps = (state) => {
  return (contacts = state.contacts);
};
export default connect(mapStateToProps)(App);
